bool prepareAfdbDatasetFiles(const boost::filesystem::path& aDir) {
  bool myDatasetFileOk;
  {
    std::ofstream myDatasetFile((aDir / "apps.csv").string());
    myDatasetFile << theAfdbApps;
    myDatasetFileOk = static_cast<bool>(myDatasetFile);
  }
  std::ifstream myDatasetStream((aDir / "apps.csv").string());
  const auto    myDataset = dataset::loadDataset(myDatasetStream, false);
  dataset::saveTimestampDataset(dataset::toTimestampDataset(myDataset),
                                (aDir / "apps").string());
  bool myTimestampFileOk;
  {
    myTimestampFileOk =
        not dataset::loadTimestampDataset((aDir / "apps").string()).empty();
  }
  return myDatasetFileOk and myTimestampFileOk;
}